import React from "react";
import { render } from "react-dom";
import Sidemenu from "../views/UtilPage/Sidemenu";
import Header from "../views/UtilPage/Header";
import styles from "./Layout.module.css";

import "../views/UtilPage/app.less";
import "../../utills/side-menu.less";

import ExampleNormal from "../views/UtilPage/example-normal";

render(<ExampleNormal />, document.getElementById("example-normal"));

export default function Layout({ children }) {
  return (
    <div className={styles.container}>
      <Header />
      <div className={styles.layout}>
        <Sidemenu />
        <div className={styles.contents}>{children}</div>
      </div>
    </div>
  );
}
